INSERT INTO `pregunta` VALUES (131,'¿Dispone de agua potable, jabón antibacterial y toallas de un solo uso, para realizar la higiene de manos en cada lavamanos?',10.00,32,1,15,2,0,'2020-07-21 19:09:56','2020-07-21 19:26:56'),(132,'¿Se siguen procedimientos de desinfección de manos al ingreso de las instalaciones?',10.00,32,2,15,2,0,'2020-07-21 19:10:22','2020-07-21 19:26:56'),(133,'¿Disponer suministros y dispensadores de alcohol glicerinado mínimo al 60% máximo 95% de acceso fácil y frecuente para el uso de colaboradores?',10.00,32,3,15,2,0,'2020-07-21 19:10:41','2020-07-21 19:26:56'),(134,'¿Hay presupuesto para el abastecimiento continuo de productos para la correcta higiene de manos?',10.00,32,4,15,2,0,'2020-07-21 19:11:00','2020-07-21 19:26:56'),(135,'¿Los colaboradores reciben formación sobre la correcta higiene de las manos?',10.00,32,5,15,2,0,'2020-07-21 19:11:19','2020-07-21 19:26:56'),(136,'¿Existe alguna metodología para evidenciar que todos los colaboradores estén cumpliendo con la pregunta anterior?',10.00,32,6,15,2,0,'2020-07-21 19:11:35','2020-07-21 19:26:56'),(137,'¿Se realiza una inspección regular sobre los dispositivos y los productos para la correcta higiene de las manos?',10.00,32,7,15,2,0,'2020-07-21 19:11:51','2020-07-21 19:26:56'),(138,'¿Existen carteles informativos explicando las indicaciones para la correcta higiene de las manos en la organización?',10.00,32,8,15,2,0,'2020-07-21 19:12:23','2020-07-21 19:26:56'),(139,'¿Los miembros del equipo directivo han manifestado explícitamente su compromiso con la correcta higiene de manos?',10.00,32,9,15,2,0,'2020-07-21 19:13:25','2020-07-21 19:26:56'),(140,'¿Los trabajadores realizan el correcto lavado de manos frecuentemente, por lo menos, con una periodicidad inferior a tres (3) horas? ',10.00,32,10,15,2,0,'2020-07-21 19:14:24','2020-07-21 19:26:56'),(141,'¿Evita las reuniones numerosas en la organización?',17.00,33,1,15,2,0,'2020-07-21 19:14:46','2020-07-21 19:26:56'),(142,'¿Los colaboradores permanecen al menos a 2 metros de distancia de otras personas y entre los puestos de trabajo evitando contacto directo?',17.00,33,2,15,2,0,'2020-07-21 19:18:30','2020-07-21 19:26:56'),(143,'¿La ARL con la que cuenta su organización le ha ayudado en la asistencia técnica para reorganizar los puestos de trabajo?',17.00,33,3,15,2,0,'2020-07-21 19:18:51','2020-07-21 19:26:56'),(144,'¿Tiene personal trabajando desde casa?',17.00,33,4,15,2,0,'2020-07-21 19:20:12','2020-07-21 19:26:56'),(145,'¿La organización les recuerda constantemente a los colaboradores que se debe mantener el distanciamiento físico tanto en el lugar de trabajo como fuera de él?',17.00,33,5,15,2,0,'2020-07-21 19:20:25','2020-07-21 19:26:56'),(146,'¿Los colaboradores permanecen al menos a 2 metros de distancia de otras personas en comedores, cafetería o lugares de descanso, en la organización?',15.00,33,6,15,2,0,'2020-07-21 19:20:45','2020-07-21 19:26:56'),(147,'¿La empresa provee a los trabajadores desde su contratación, los EPP de bioseguridad adecuados y garantiza su disponibilidad y recambio continuo?',8.00,34,1,15,2,0,'2020-07-21 19:21:12','2020-07-21 19:26:56'),(148,'¿Los colaboradores permanecen con tapabocas a la hora de interactuar con sus otros compañeros de trabajo? ',8.00,34,2,15,2,0,'2020-07-21 19:21:28','2020-07-21 19:26:56'),(149,'¿Se realiza capacitaciones a los colaboradores, recordando el uso correcto de los EPP de Bioseguridad adecuados?',8.00,34,3,15,2,0,'2020-07-21 19:21:43','2020-07-21 19:26:56'),(150,'¿La empresa verifica que todos los colaboradores porten correcta y permanentemente, si es del caso, los EPP de bioseguridad adecuados?',8.00,34,4,15,2,0,'2020-07-21 19:21:57','2020-07-21 19:26:56'),(151,'¿La organización cuenta con recipientes adecuados para el destino final de los elementos de protección personal utilizados?',8.00,34,5,15,2,0,'2020-07-21 19:22:14','2020-07-21 19:26:56'),(152,'¿Los colaboradores tienen presente que los EPP de bioseguridad no pueden ser compartidos con los compañeros de trabajo?',8.00,34,6,15,2,0,'2020-07-21 19:22:29','2020-07-21 19:26:56'),(153,'¿Los tapabocas que usa cada colaborador se cambian según las recomendaciones del fabricante?',8.00,34,7,15,2,0,'2020-07-21 19:22:43','2020-07-21 19:26:56'),(154,'¿Los tapabocas son usados por todos los miembros de la organización, sin importar su rango o condición, en cualquier momento y espacio dentro de ella?',8.00,34,8,15,2,0,'2020-07-21 19:22:59','2020-07-21 19:26:56'),(155,'¿La organización ha identificado los EPP de bioseguridad indicados para la prevención de enfermedades transmitidas por bacterias y virus?',8.00,34,9,15,2,0,'2020-07-21 19:23:16','2020-07-21 19:26:56'),(156,'¿La organización cumple con las recomendaciones del fabricante, detalladas en las fichas técnicas de los EPP de bioseguridad adquiridos para la prevención de enfermedades transmitidas por bacterias y virus?',8.00,34,10,15,2,0,'2020-07-21 19:23:34','2020-07-21 19:26:56'),(157,'¿Los trabajadores practican la rutina del correcto lavado de manos antes y después de usar el tapabocas?',8.00,34,11,15,2,0,'2020-07-21 19:23:52','2020-07-21 19:26:56'),(158,'¿Los EPP de bioseguridad no desechables, son lavados y desinfectados antes de ser almacenados?',8.00,34,12,15,2,0,'2020-07-21 19:24:09','2020-07-21 19:26:56'),(159,'¿Los proveedores, asesores, contratistas, clientes y visitantes cumplen con el porte y uso correcto de tapabocas al ingreso y estancia en la organización?',4.00,34,13,15,2,0,'2020-07-21 19:24:25','2020-07-21 19:26:56'),(160,'¿En la organización, realizan una constante limpieza y desinfección de los contenedores donde almacenan los productos?',20.00,35,1,15,2,0,'2020-07-21 19:24:56','2020-07-21 19:26:56'),(161,'¿Los colaboradores que trabajan en este proceso utilizan los EPP adecuados?',20.00,35,2,15,2,0,'2020-07-21 19:25:10','2020-07-21 19:26:56'),(162,'¿Cuenta con un lugar adecuado para la desinfección y cargue de la mercancía de uso frecuente de los diferentes proveedores que distribuyen su mercancía? ',20.00,35,3,15,2,1,'2020-07-21 19:25:34','2020-07-21 19:26:56'),(163,'¿Cuenta con un lugar adecuado para la desinfección y recepción de las materias primas e insumos, a ser almacenada en los puntos destinados para el almacenamiento de la organización?',20.00,35,4,15,2,0,'2020-07-21 19:25:53','2020-07-21 19:26:56'),(164,'¿Los proveedores cumplen con las rutinas de desinfección correcta de las manos antes de hacer la entrega de mercancía o insumos?',20.00,35,5,15,2,0,'2020-07-21 19:26:15','2020-07-21 19:26:56'),(165,'¿Los colaboradores conocen la política de Seguridad y Salud en el Trabajo de la organización?',11.00,36,6,15,2,0,'2020-07-21 19:26:42','2020-07-21 19:29:04'),(166,'¿Desde el área de SG-SST diseñan actividades de recordación de la política?',11.00,36,7,15,2,0,'2020-07-21 19:27:19','2020-07-21 19:29:04'),(167,'¿Realizan actividades periódicas para socializar cuales son los deberes y derechos de los colaboradores frente a la política de SG-SST?',11.00,36,8,15,2,0,'2020-07-21 19:27:36','2020-07-21 19:29:04'),(168,'¿Promueve una cultura de autocuidado para la prevención de contagios por exposición a bacterias, virus y enfermedades infecciosas-respiratorias?',11.00,36,9,15,2,0,'2020-07-21 19:27:52','2020-07-21 19:29:04'),(169,'¿Realizan capacitaciones constantes para controlar la exposición a los riesgos y eliminar los peligros en la organización?',11.00,36,10,15,2,0,'2020-07-21 19:28:05','2020-07-21 19:29:04'),(170,'¿Se realiza monitoreos a los trabajadores sobre la temperatura y el uso correcto de los EPP de Bioseguridad?',11.00,36,11,15,2,0,'2020-07-21 19:28:18','2020-07-21 19:29:04'),(171,'Si el colaborador presenta síntomas de infección respiratoria como: fiebre, tos, dificultad para respirar, fatiga, secreciones nasales o presenta temperaturas de 38°C o superiores. ¿Esta condición es informada inmediatamente a la EPS respectiva del trabajador?',11.00,36,12,15,2,0,'2020-07-21 19:28:31','2020-07-21 19:29:04'),(172,'¿Se tiene establecido un prot